import React, { Component } from 'react'




class Student extends Component {
    constructor(props){
        super(props);
        this.state = {
            name:'Lathesh',
            roll:this.props.roll
        };
    }
   
    render(){
        return (
            <div>
                <h1>Hello Lathesh</h1>
                <button oncli>Click</button>
            </div>
        )
    }
 
}

export default Student;
